import { StyleSheet } from "react-native";

export const estilos = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        backgroundColor: '#252525'
    },
    input: {
        backgroundColor: '#303030',
        height: 50,
        width: "90%",
        paddingHorizontal: 10,
        marginTop: 10,
    },
    botao: {
        alignItems: 'center',
        height: 50,
        marginTop: 10,
        backgroundColor: '#303030',
        borderRadius: 20,
        paddingHorizontal: 15,
        alignItems: 'center',
        justifyContent: 'center',
        borderWidth: 2,
        borderColor: '#F4C095',
    },
    texto: {
        color: '#F4C095'
    }
})
